import styled from 'styled-components';

export const Container = styled.div`
    span#title {
        font-size: 28pt;
        margin-right: 20px;
    }

    span#buttons {
        align-self: left;
    }

    Button {
        margin: 0 10px 15px 0;
    }
`;
